import { Section, Title, ListOfFollowers } from "./styles";

const followersContainer = (props) => {
    return (
        <Section>
            <Title>Followers of {props.name?.split("")[0]}</Title>
            <ListOfFollowers></ListOfFollowers>
        </Section>
    );
};

export default followersContainer;
